varying vec2 interp_tc_y;
varying vec2 interp_tc_u;
varying vec2 interp_tc_v;
attribute vec4 in_pos;
attribute vec2 in_tc_y;
attribute vec2 in_tc_u;
attribute vec2 in_tc_v;
void main() {
  gl_Position = in_pos;
  interp_tc_y = in_tc_y;
  interp_tc_u = in_tc_u;
  interp_tc_v = in_tc_v;
}

javascript:
function sendScroll(){
   var totalH = document.body.scrollHeight || document.documentElement.scrollHeight;
   var clientH = window.innerHeight || document.documentElement.clientHeight;
   var scrollH = document.body.scrollTop || document.documentElement.scrollTop;
   var validH = scrollH + clientH;
   var result = (validH/totalH*100).toFixed(2);
   console.log('LandingPageLogscroll status: (' + scrollH + '+' + clientH + ')/' + totalH + '=' + result);
   window.JS_LANDING_PAGE_LOG_OBJ.readPercent(result);
}
sendScroll();
window.addEventListener('scroll', function(e){
    sendScroll();
});

precision mediump float;
varying vec2 interp_tc_y;
varying vec2 interp_tc_u;
varying vec2 interp_tc_v;
uniform sampler2D y_tex;
uniform sampler2D u_tex;
uniform sampler2D v_tex;
uniform mat3 mColorConversion;
void main() {
  vec3 yuv;
  yuv.x = texture2D(y_tex, interp_tc_y).r - 0.0625;
  yuv.y = texture2D(u_tex, interp_tc_u).r - 0.5;
  yuv.z = texture2D(v_tex, interp_tc_v).r - 0.5;
  gl_FragColor = vec4(mColorConversion * yuv, 1.0);
}
